import Link from 'next/link'
import style from './index.module.css'

function HomePage() {
    return ( 

    <div className={style.header}>
        <style jsx global>{`
            * {
                margin: 0;
                padding: 0;
                box-sizing: border-box;
            }
        `}</style>
        <Link href="/">
            <a className={style.link}>Sobre</a>
        </Link>

        <Link href="/sobre">
            <a className={style.link}>Sobre</a>
        </Link>
        <Link href="/contato">
            <a className={style.link}>Conato</a>
        </Link>
    </div>)
}
  
export default HomePage
